import React from "react";
import logo from './../Assets/logo.png'

const landing = ()=>{
    return (
        <div>
            <div className="flex justify-center m-30">
            <img src={logo} className="app-logo" alt="logo"/>
            </div>
        </div>
    )
}
export default landing;
